export const userFormInfo = (tesInfo) => {
    return (
        [
            {
                label: 'Nom',
                info: tesInfo.lastname,
                id: 'lastname',
                type:'text',
                small: false,
                stateInfo: tesInfo.infoStateLastname
            },

            {
                label: 'Prénom',
                info: tesInfo.firstname,
                id: 'firstname',
                type:'text',
                small: false,
                stateInfo: tesInfo.infoStateFirstname
            },

            {
                label: 'Nom d\'utilisateur',
                info: tesInfo.username,
                type:'text',
                small: 'ex: pseudo, pseudo46, pseudo-46, pseudo_46 (15 car. max).',
                id: 'username',
                stateInfo: tesInfoinfoState.username
            },

            {
                label: 'E-mail',
                info: 'ok',//email,
                type:'email',
                small: false,
                id: 'email',
                stateInfo: 'ok'//infoState.email
            }

        ] 
    )
}
